import React from 'react';
import { Navbar, Nav, NavLink } from 'react-bootstrap';
import Chatbot from '../Charbot/Chatbot';
import './TopNav.css';

function TopNav() {
  return (
    <Navbar className="top-nav" expand="lg">
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Link eventKey='1' as={NavLink} to='/homepage'>
            Home
          </Nav.Link>
          <Nav.Link eventKey='2' as={NavLink} to='/homepage'>
            App
          </Nav.Link>
          <Nav.Link eventKey='3' as={NavLink} to='/homepage'>
            Chatbot
          </Nav.Link>
          <Nav.Link eventKey='1' as={NavLink} to='/homepage'>
            Agent
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default TopNav;
